import {del, get, post, put} from "./HttpService";
import endpoints from "../config/endpoints";

export default class FormService {

    static searchForm(dataSearch = {nextToken: "", limit: 10, query: {}}) {
        return get(endpoints.formManagement.list, dataSearch).then(value => {
            return value ? value.data : null;
        });
    }

    static removeForm(id) {
        return del(endpoints.formManagement.delete.replace(":ID", id)).then(value => {
            return value ? value.data : null;
        });
    }

    static getForm(id) {
        return get(endpoints.formManagement.get.replace(":ID", id)).then(value => {
            return value ? value.data : null;
        });
    }

    static updateForm(id, form) {
        return put(endpoints.formManagement.update.replace(":ID", id), form).then(value => {
            return value ? value.data : null;
        });
    }

    static createForm(form) {
        return post(endpoints.formManagement.create, form).then(value => {
            return value ? value.data : null;
        });
    }
}
